export class  Transacao {
    usuarioId: string;
    tipo: string;
    valor: number;
    data: Date;
    descricao: string;
    moeda: string;
  
    constructor(usuarioId: string, tipo: string, valor: number, data: Date, descricao: string, moeda: string) {
      this.usuarioId = usuarioId;
      this.tipo = tipo;
      this.valor = valor;
      this.data = data;
      this.descricao = descricao;
      this.moeda = moeda;
    }
  }
